import React, { Component } from 'react';
import {Navbar,Nav,Container} from 'react-bootstrap';

export default class NavBarComp extends Component {
    render(){
        return(
            <div>
                <Navbar bg="light" expand="lg">
                <Container>
                    <Navbar.Brand href="/Home.js">ASTA SHOP</Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="me-auto">
                        <Nav.Link href="/Home.js">HOME</Nav.Link>
                        <Nav.Link href="/lentes.js">LENTES</Nav.Link>
                        <Nav.Link href="/medias.js">MEDIAS</Nav.Link>
                        <Nav.Link href="/contactanos.js">CONTACTANOS</Nav.Link>
                    </Nav>
                    </Navbar.Collapse>
                </Container>
                </Navbar>
            </div>
        )
    }
}
